(21, 1, 'http://linws.b.tu-harburg.de:8080/cocoon/tubdok/formblatt_pod.pdf', '', 'Der Veröffentlichungsvertrag für Publikationen mit Print on Demand. Damit geben Sie der Universitätsbibliothek der Technischen Universität Hamburg-Harburg das (nicht-exklusive) Recht, die Arbeit weltweit frei zugänglich im Internet zu veröffentlichen.\nSie bleiben als AutorIn selbstverständlich aber EigentümerIn der Urheberrechte und haben weiterhin das Recht, die Publikation anderweitig zu veröffentlichen, zu verändern oder in sonstiger Weise zu verwerten.\n Sie geben einem Leser die Möglichkeit, mit unserer Vermittlung ein Print-on-Demand-Exemplar herzustellen. Es handelt sich um einen Zusatz-Service ohne kommerzielle Interessen.', 'deu', '/doku/lic_mit_pod.php', '/Icons/unilogo.gif', '/doku/lizenzen/formblatt_pod.pdf', 'text/html', 'Veröffentlichungsvertrag für Publikationen mit Print on Demand', 1, 5),
(22, 1, 'http://linws.b.tu-harburg.de:8080/cocoon/tubdok/formblatt.pdf', '', 'Der Veröffentlichungsvertrag für Publikationen ohne Print on Demand. Damit geben Sie der Universitätsbibliothek der Technischen Universität Hamburg-Harburg das (nicht-exklusive) Recht, die Arbeit weltweit frei zugänglich im Internet zu veröffentlichen.\nSie bleiben als AutorIn selbstverständlich aber EigentümerIn der Urheberrechte und haben weiterhin das Recht, die Publikation anderweitig zu veröffentlichen, zu verändern oder in sonstiger Weise zu verwerten. Der Zusatzservice Print on Demand wird hier ausgeschlossen.', 'deu', '/doku/lic_ohne_pod.php', '/Icons/unilogo.gif', '/doku/lizenzen/formblatt.pdf', 'text/html', 'Veröffentlichungsvertrag für Publikationen ohne Print on Demand', 0, 6),
