INSERT INTO `document_title_abstracts` (`id`, `document_id`, `type`, `value`, `language`) VALUES
(1, 1, 'main', 'Wilhelm Ostwald, the "Brücke" (Bridge), and connections to other bibliographic activities at the beginning of the twentieth century', 'eng'),
(2, 1, 'abstract', 'This paper gives a summary of the activities of the German chemist and\nNobel laureate Wilhelm Ostwald (1853 - 1932) in the area of scholarly information, communication, and publication at the beginning of the twentieth\ncentury. In 1911 Ostwald, with others, founded the "Brücke" (Bridge),\nan organization with aims similar to those of the famous Institut International\nde Bibliographie in Brussels. The paper looks at connections to other\ninstitutions and individuals in the area of documentation and information\nscience, especially in Germany, for example, the Institut für Techno-\nBibliographie and the German librarian Julius Hanauer, one of the German\npromoters of the Universal Decimal Classification.\n', 'eng'),
(3, 2, 'main', 'Informationskompetenz und studentisches Lernen im elektronischen Zeitalter : Problemfelder und Praxisansätze in einer Technischen Universität.', 'deu'),
(4, 2, 'main', 'Information literacy and student learning in the electronic age : fields of problems and practical approaches in an university of technology', 'eng'),
(5, 2, 'abstract', 'Die Integration der Vermittlung von allgemeiner und fachlicher\nInformationskompetenz in das Lernen und Lehren an unseren Universitäten ist\neine wichtige Voraussetzung für die zeitgemässe Qualifizierung von\nHochschulabsolventen. Der Beitrag gibt eine Übersicht zur Ausgangssituation, zu\nProblemen, Zielen, Inhalten und Methoden der Vermittlung von\nInformationskompetenz im Rahmen studentischen Lernens aus der Sicht der\nUniversitätsbibliothek einer Technischen Universität.', 'deu'),
(6, 3, 'main', 'Interface characterization of metal-gate MOS-structures and the application to DRAM-capacitors', 'deu'),
(7, 3, 'main', 'Interface characterization of metal-gate MOS-structures and the application to DRAM-capacitors', 'eng'),
(8, 3, 'abstract', 'Viele Applikationen der modernen Informationstechnologie benötigen einen Arbeitsspeicher mit kurzen Schreib- und Lesezeiten sowie geringen Kosten pro Bit. Moderne DRAMs sind zur Zeit die einzigen Schaltkreise, die diese Anforderungen erfüllen. Eine kontinuierliche Verkleinerung der Strukturabmessungen ist für die Erhöhung der Produktivität\nund somit für eine weitere Verringerung der Kosten pro Bit erforderlich. Gleichzeitig bleibt jedoch die Kapazität der DRAM Speicherzelle mit jeder Generation konstant, was zu dreidimensionalen Kondensatoren mit hohen Aspektverhältnissen und hohen Reihenwiderständen führt. Nach der ITRS Roadmap muß daher ab der 70 nm Generation das üblicherweise verwendete polykristalline Silizium durch ein Material mit höherem Leitwert ersetzt werden.<br />\nIn dieser Arbeit wird ein Stapel aus polykristallinem Silizium und einer d&uuml;nnen Metallschicht als geeigneter Ersatz für das reine Silizium vorgeschlagen. Es wird eine vollständige Analyse-Prozedur für Metall-Gate MOS-Strukturen entwickelt, die die Identifizierung von Problemen während der Prozessierung und die Extraktion physikalischer Parameter ermöglicht. Aus Simulationen von MOS-Kondensatoren werden Größen gewonnen, die eine automatische Extraktion der Flachbandspannung und der physikalischen Oxyddicke zulassen und dabei eine Genauigkeit von 1-2 °A verglichen mit ellipsometrischen Messungen und IV-Analysen zeigen. Weiterhin wird ein verbessertes Modell zur Simulation des Leckstroms präsentiert welches die Meßdaten für alle untersuchten Spannungen und Oxyddicken sehr gut beschreibt. Zur Anwendung der Analyse-Prozedur werden ein Testchip und dazugehörige Prozesstechnologie für Metall-Gate MOS-Strukturen auf Kurzdurchläufern und auf vollintegrierten Losen entwickelt. TiN-Gate Strukturen werden benutzt, um einen Prozess zur TiN Atomlagen-Abscheidung zu charakterisieren, Probleme zu identifizieren und diese zu lösen.<br />\nDie thermische Stabilität reiner Metall-Gate Elektroden ist f&uuml;r eine DRAM Anwendung mit Grabenkondensatoren nicht ausreichend. Ein Stapel von 25 nm polykristallinem Silizium und 20 nm TiN wird als geeignete niederohmige Grabenf&uuml;llung identifiziert, die bis zu 1050 ±C stabil ist. Um solch ein Materialsystem in einen DRAM zu integrieren muss das Metall in tiefen Gräben mit guter Kantenbedeckung abgeschieden werden. Zu diesem Zweck wird die Gasphasenabscheidung von Wolfram Silizid untersucht und das gleichzeitige Erreichen von guter Kantenbedeckung und einer thermisch stabilen Zusammensetzung als größte Herausforderung identifiziert. Ein Abscheide-Regime für solch einen Prozeß wird vorgeschlagen, das jedoch außerhalb des in dieser Arbeit zugänglichen Bereiches liegt. Auf der anderen Seite wird eine TiN Atomlagen-Abscheidung erfolgreich modifiziert um 70% Kantenbedeckung in Gräben mit einem Aspektverhältnis von 40:1 zu erhalten. Mit diesem Prozeß werden Grabenkondensatoren hergestellt, die eine 60 s Temperung bei 1050 ±C aushalten und gleichzeitig die Anforderungen für den Leckstrom und die Kapazit&auml;at erfüllen. Zusammenfassend ermöglichen die in dieser Arbeit präsentierten Ergebnisse die Herstellung von niederohmigen Grabenf&uuml;llungen von DRAM-Kondensatoren so wie sie für eine 70 nm Technologie-Generation benötigt werden.', 'deu'),
(9, 3, 'abstract', 'The main result of this study is the development of a full analysis procedure for metal-gate MOS-structures that allows to identify problems during processing and to extract physical parameters of metal electrodes. With knowledge gained from this analysis a polysilicon/TiN-stack has been developed and successfully integrated as low-resistance electrode into state-of-the-art deep trench DRAM-capacitors. These electrodes will be required to fabricate sub-100 nm deep trench DRAMs.', 'eng'),
(10, 4, 'main', 'Gegenstromtrennung von schwerflüchtigen Naturstoffen mit überkritischen komprimierten Gasen unter Verwendung von Schleppmitteln', 'deu'),
(11, 4, 'main', 'Countercurrent separation of low volatile liquid natural products with supercritical gases', 'eng'),
(12, 4, 'abstract', 'In dieser Arbeit wurden Untersuchungen zur Anreicherung von Vitaminen aus rohem\nPalmöl durchgeführt. Die im verwendeten Öl enthaltenen 300 ppm Tocochromanole\n(Vitamin E) und 400 ppm &#946;-Carotin (Provitamin A) sollen durch Gegenstromextraktion mit überkritischem Kohlendioxid angereichert werden.', 'deu'),
(13, 4, 'abstract', 'The investigations deal with the enrichment of tocochromanoles (vitamin E) and beta-carotene (provitamin A) from crude palm oil. In a first separation step the tocochromanoles and free fatty acids are removed using countercurrent supercritical fluid extraction (SFE) with supercritical CO2. The refined oil is esterified and then fractionated in fatty acid methyl esters (FAME, bio diesel) and a mixture of countercurrent beta-carotene and FAME using SFE.', 'eng'),
(14, 5, 'main', 'Ein Beitrag zur quasi-optischen Leistungsaddition mit periodischen Strukturen', 'deu'),
(15, 5, 'main', 'A contribution to the quasi-optical power combining with periodic structures', 'eng'),
(16, 5, 'abstract', 'Die Arbeit untersucht Multi-Element-Schaltungstechniken zur quasi-optischen Leistungsaddition. Methoden für den Einsatz periodischer Strukturen zur Strahlteilung und -summierung im Submillimeterwellenbereich werden verglichen. Zum einen gibt es Fernfeldmethoden, die ihren Ursprung im Dammann-Gitter haben, zum anderen Nahfeldmethoden - wie die näher untersuchte holographische Leistungsaddition mit periodischen Strukturen -, welche auf dem Talbot-Effekt basieren. Der Wirkungsgrad wird mit einem exakten Modell aus verallgemeinerten Streuparametern und Eigenwellen-Entwicklung erforscht. Die resultierende räumlich begrenze, ebene Welle wird mit einer geeigneten Auskoppelschaltung in einen Gaussstrahl umgewandelt, indem die Phase durch spezielle Linsen oder Spiegel beeinflusst wird. Eine näherungsweise Bestimmung der Obeflächenkonturen erfolgt mit strahlenoptischer Zuordnung per Leistungsverteilungsfunktion. Für die Optimierung wird die lokale Strahlenoptik eingeführt. Die Justage und Bewertung der realisierten Aufbauten bei 150 GHz erfolgt u. a. mit einem vektoriellen Feldmesssystem und breitbandigen Leistungsteiler.', 'deu'),
(17, 5, 'abstract', 'This thesis investigates multi-element circuit technologies for quasi-optical power combining. For this purpose, methods for the application of periodic structures for splitting and summarization of rays in the submillimeter wave range are compared. On the one hand, there are far field methods, which have their origin in the Dammann grating. On the other hand, there are near field methods - like the analysed holographic power combining with periodic structures - which are based on the Talbot effect. The power combining efficiency is examined via a rigorous model which consists of generalized scattering matrixes and eigenmode development. The resulting pseudo plane wave is transformed into a Gaussian beam with an adequate quasi-optical circuit. This is performed by modification of the phase distribution with specially designed lenses and mirrors. An approximated determination of the surface contours is performed by geometrical optics with power distribution mapping. For their optimisation the local geometrical optics is introduced. The adjustment and validation of the realized set-ups at 150 GHz is performed by a vectorial field measurement system and a broadband power divider.', 'eng'),
(18, 6, 'main', 'Tribologie und Fluidverhalten in der Dichtzone von Radialwellendichtringen unter Berücksichtigung makromolekularer Bestandteile der Schmierfluide', 'deu'),
(19, 6, 'main', 'Tribology and fluid behavior of rotary shaft seals ...', 'eng'),
(20, 6, 'abstract', 'Der Radialwellendichtring (RWDR) ist selbst beim heutigen Stand der Technik in seiner Funktion nicht ausreichend beherrscht. Konzipiert für die berührende Abdichtung von Wellendurchtritten in Gehäusen, soll ein Austritt des Schmiermediums in die Umwelt und das Eindringen von Schmutz aus der Umwelt in das Gehäuse verhindert werden. Vorliegende Arbeit analysiert die RWDR/Welle/Fluid-Paarung aus der Perspektive des Fluids. Der komplexen Vorgänge in der RWDR-Dichtzone wird durch die versuchstechnische und theoretische Betrachtung der tribologischen Vorgänge bis in den Sub-Mikrometer-Bereich Rechnung getragen. Aus den Ergebnissen wird ein tribologisches 3-Schichtmodell und die zugehörige allgemeine Reibungskurve entwickelt. Ausgehend von der RWDR-Funktionshypothese von Oliveira wird eine Betrachtung des Verhaltens der makromolekularen Bestandteile im Fluid durchgeführt. Geometriebedingt existiert in der RWDR-Dichtzone und an ihren Rändern ein Scherratengradient, der eine ungleichmäßige Belastung der makromolekularen Bestandteile hervorruft. Die Auswirkung eines Scherratengradienten auf die Zusammensetzung einer polymeren Lösung wird experimentell untersucht. Die Ergebnisse aus dem Scherversuch deuten auf eine Konzentrationserhöhung der polymeren Bestandteile im Bereich der höchsten Scherraten hin. Dieses Ergebnis kann als ein Indiz für die Gültigkeit der RWDR-Funktionshypothese von Oliveira gesehen werden.', 'deu'),
(21, 6, 'abstract', 'Tribology and fluid behavior of rotary shaft seals ...', 'eng'),
(22, 7, 'main', 'Die Zeitschrift für physikalische Chemie - Ein Beitrag bibliothekarischer Zeitschriftenforschung', 'deu'),
(23, 7, 'main', 'The first German journal for physical chemistry', 'eng'),
(24, 7, 'abstract', 'Die Zeitschrift für physikalische Chemie . Vortrag auf dem 65. Berliner Wissenschaftshistorischen Kolloquium des Bereiches Wissenschaftsgeschichte am Institut für Theorie, Geschichte und Organisation der Wissenschaften der Akademie der Wissenschaften Berlin am 18.6.1991. \n(Zusammenfassung von Thomas Hapke: Die Zeitschrift für physikalische Chemie : 100 Jahre Wechselwirkung zwischen Fachwissenschaft, Kommunikationsmedium und Gesellschaft. Herzberg: Bautz, 1990.)', 'deu'),
