(26, 8, 'main', 'Krylov-Unterraum-Verfahren in endlicher Genauigkeit : ein vereinheitlichter Ansatz', 'deu'),
(27, 8, 'main', 'Krylov Subspace Methods in Finite Precision :  A Unified Approach', 'eng'),
(28, 8, 'abstract', 'This thesis is concerned with the error analysis of the most common Krylov\nsubspace methods for the solution of the algebraic eigenvalue problem and the\nsolution of linear systems. It contains a new form of error analysis for these\nmethods. The main concern lies in the unification and extension of well-known\nerror analysis approaches.', 'eng'),
(29, 8, 'abstract', 'Die Dissertation beschäftigt sich mit der Fehleranalyse bekannter\nKrylov-Unterraum-Verfahren für die Lösung des algebraischen Eigenwertproblems\nund die Lösung linearer Gleichungssysteme. Sie enthält eine neue Form der\nFehleranalyse der genannten Verfahren. Das Hauptaugenmerk liegt auf der\nVereinheitlichung und Verallgemeinerung bereits bestehender Analysen.', 'deu'),
