(36, 10, 'abstract', 'Die Arbeit löst Interoperabilitätsprobleme von Webservices. Der W3C-Standard zur\nSpezifikation ihrer Schnittstellen (WSDL) wird präzisiert. Dazu wird ein Spezifikationsverfahren (SXQT) entwickelt, das erlaubt, Schnittstellen mit prädikatenlogischen Ausdrücken (in XQuery) zu spezifizieren. Die Einhaltung solcher Spezifikationen wird mit der automatischen Validation geprüft.', 'deu'),
(37, 10, 'abstract', 'The thesis solves interoperability issues regarding Web Services. The W3C standard for the specification of their interfaces (WSDL) is made more precise. This is done by developing a specification technique (SXQT), which allows specifying interfaces using expressions of first order logic (in XQuery). Compliance with such specifications is checked with the automatic validation.', 'eng'),
