(66, 25, 'main', 'Numerische Optimierung von Implantaten zur Versorgung von Hernien', 'deu'),
(67, 25, 'main', 'Numerical optimization of implants for treatment of hernia repair', 'eng'),
(68, 25, 'abstract', 'Hernien, Ausstülpungen von Bauchfell aus der Bauchhöhle, werden heutzutage häufig mit Kunststoffnetzen verstärkt. Trotzdem gibt es eine bedeutende Anzahl von Rezidivhernien und andere Komplikationen. Die Arbeit analysiert die Ursachen der Probleme und zeigt Möglichkeiten der Netzoptimierung auf. Weil Hernienreparationen die häufigsten Operationen beim Menschen sind, hat die Problemstellung herausragende wirtschaftliche Bedeutung.\n', 'deu'),
(69, 25, 'abstract', 'Hernias, protuberances of peritoneum out of the abdominal cavity, are often reinforced by polymeric meshes. None the less there are quite a few recurrences and other complications. The thesis analyses the causes of the problems and shows possibilities of mesh optimization. Because hernia repairs are the most frequently conducted surgeries, the problem is of great economical interest.', 'eng'),
