(98, 40, 'main', 'Designanalyse von endovaskulären Aortenprothesen', 'deu'),
(99, 40, 'main', 'Design analysis of EVAR', 'eng'),
(100, 40, 'abstract', 'In den letzten Jahren hat sich die endovaskuläre Versorgung von abdominalen Aorten-Aneurysmen mittels Stentgrafts neben der konventionellen, offenen Operation als Alternativverfahren zur Vermeidung einer Gefäßruptur etabliert. Das erkrankte Gefäß wird durch eine Schlauchprothese überbrückt und somit vom systemischen Druck abgeschirmt. Trotz der Weiterentwicklung von endovaskulären Aortenprothesen in den letzten 15 Jahren weist die minimal-invasive Versorgung noch eine Re-Interventionsrate von 20% innerhalb von 4 Jahren auf. Mangelnde Abdichtung und Migration der Prothesen zählen zu den häufigsten Versagensursachen.\nIn dieser Arbeit wurden Faktoren für das Versagen von Stentgrafts identifiziert, Grundlagen zur Testung dieser Prothesen gelegt sowie Designkriterien zur Weiterentwicklung dieser Prothesen abgeleitet. Auf Grundlage von klinischen Daten, Experimenten und Berechnungen wurde eine Bestimmung und Beurteilung von Migrations- und Abdichtungsparameter qualitativ\nund quantitativ ermöglicht.\nIn 80% der untersuchten Patienten waren ein Fixierungsverlust infolge einer Gefäßdilatation oder das Abknicken der Prothese verantwortlich für die Migration der Prothesen. Es wurde gezeigt, dass die Permeabilität von Thrombus zu einem erhöhten Druck im Aneurysmasack und somit zu einem Versagen der Behandlung bei wasserdurchlässigen Prothesen und kurzen Fixierungszonen führt. Endoleckagen II verursachen eine Wiederbelastung der Gefäßwand bis zu Werten des systemischen Drucks und führen häufig zum Anwachsen des Aneurysmas.\nAufgrund der hohen Inzidenz dieser Leckage wurde ein neues Prothesendesign in Form einer dünnen, überdimensionierten Membran entwickelt, welche einen Verschluss der Kollateralen ermöglicht. Erste Ergebnisse zeigten, dass durch das Auskleiden des Aneurysmas eine verbesserte Abdichtung des Aneurysmas im Vergleich zu einer Standardprothese und eine adäquate Fixierung im Gefäß erzielt werden.', 'deu'),
(101, 40, 'abstract', 'In recent years minimally-invasive endovascular surgery of abdominal aortic aneurysms by means of stentgrafts has emerged alongside conventional open surgery as an alternative procedure for the prevention of vessel rupture. The degenerated vessel is bridged by a tubular prosthesis and is thereby decoupled from the systemic pressure. Despite the continuous evolution of endovascular stentgrafts over the last 15 years minimally-invasive treatment still suffers\na re-intervention rate of 20% within 4 years. Inadequate sealing and migration of the prostheses rank among the most frequent failure causes.\nIn this study, factors of stentgraft failure were identified, basic principles for component testing were established and design criteria for the development of prostheses were derived.\nBased on clinical data, parametric and patient-specific in vitro experiments and on mathematical models, fixation and flow forces were related to occurrence of migration in individual patients. Based on in vitro permeability measurements of thrombus and clotted grafts an analytical model was used to investigate the role of the thrombus as a sealing medium against pressure build-up in the aneurysm sac. Additionally, the influence of retrograde flow through the collateral vessels into the bridged aneurysm (endoleak II) on the pressure acting in the aneurysm was analyzed.\nIn 80% of the patient data examined, a loss of fixation due to vessel dilation in the fixation region, or kinking of the prosthesis, were responsible for migration of the prostheses. The permeability of the thrombus was found to be sufficiently high to lead to pressurisation of the aneurysm sac and thus to a failure of the treatment for a permeable prosthesis and short attachment zones. Endoleak II was found topotentially lead to re-pressurization of the vessel\nwall up to the systemic pressure and was frequently found to be the cause for dilatation of the aneurysm clinically.\nDue to the high incidence of this leakage type a new design was proposed, to completely seal the collateral vessels by means of a thin, oversized membrane. It was demonstrated that sealing of the aneurysm was improved in comparison to a standard prosthesis and appropriate fixation stability could be achieved with the new implant design.', 'eng'),
(102, 41, 'main', 'Ein Beitrag zur numerischen und experimentellen Untersuchung extremer Schiffsbewegungen', 'deu'),
(103, 41, 'abstract', 'Die Dynamik von Schiffen kann bei kleinen Anregungen durch lineare Modelle exakt beschrieben und analysiert \n		werden. Wachsen die Anregungen, können die Bewegungen Amplituden annehmen, bei denen die Nichtlinearitäten des Systems nicht mehr \n		vernachlässigt werden können. In diesen Fällen können das Bewegungsverhalten und das Vorhandensein kritischer Bewegungszustände nur \n		noch im Zeitbereich untersucht werden, was auf Simulationen hinausläuft. Das Ergebnis einer Simulation eines nichtlinearen dynamischen \n		Systems ist jedoch stark von den Parametern des Systems sowie von den Anfangsbedingungen abhängig, so dass zu jeder Kombination aus \n		Anfangsbedingungen und Systemparametern eine Simulation erstellt werden müsste, um die Reaktion eines Schiffes auf alle relevanten \n		Seegangsbedingungen bewerten zu können.\n\nSeit zwei Jahrzehnten stehen effiziente mathematische Analyseverfahren zur Behandlung stark nichtlinearer Probleme zur Verfügung. In dieser Arbeit wird \nmit Hilfe der lokalen Verzweigungsanalyse die Existenz kritischer Bewegungsformen gezeigt. Die hydrodynamischen Kräfte und Momente werden dabei mit dem \nProgrammpaket Simbel berechnet. Trotz einer Modifikation der in Simbel implementierten Hydrodynamikberechnung stellte sich heraus, dass die Analyse eines \nvollständig modellierten Schiffes bis heute noch nicht zufriedenstellend gelingt, da die Rechenzeiten immer noch sehr lang sind. Das gleiche gilt für die \nMöglichkeit, in Versuchen preisgünstig gezielt kritische Stellen, die zu einer abrupten Änderung des Systemverhaltens durch eine minimale \nParameteränderung führen, im Experiment zu zeigen. Dabei soll es in diesen Versuchen im Entwicklungsstadium der Methoden nicht um die Untersuchung eines \nspeziellen Schiffsrumpfes unter möglichst realen Seegangsbedingungen gehen, sondern um den experimentellen Nachweis der numerisch ermittelten Phänomene. \n\nIn der vorgestellten Arbeit wird zu beiden Problemen ein Lösungsansatz entwickelt und die Tauglichkeit demonstriert. Für die Versuche ist ein Versuchsschwimmkörper mit einfacher Geometrie entwickelt worden, mit dem im Labor des Institutes umfangreiche Parameterstudien kostengünstig durchgeführt\nwerden können. Das dafür entwickelte berührungslose Positions- und Lagemesssystem liefert Messwerte mit einer Genauigkeit von bis zu einem halben Millimeter in den translatorischen und von einem Hundertstel Grad bei den rotatorischen Freiheitsgraden bei einer Frequenz von 228Hz. Diese Präzision bei einer so hohen Dynamik wird durch den Einsatz eines integrierten Messsystems aus Stereokamera und einer Inertialmesseinheit (IMU) der tactical grade–Klasse, die durch ein erweitertes kontinuierlich–diskretes Kalman–Filter in Echtzeit miteinander kombiniert werden, erreicht. Sowohl die IMU als auch die Stereokamera wurden aus Standardkomponenten aufgebaut, so dass sämtliche Sensorrohdaten und die Zwischenwerte jeder Verarbeitungsstufe vorliegen. Dieser Vorteil im Vergleich zum Einsatz einer kommerziellen IMU oder Stereokamera ermöglicht die Umsetzung unterschiedlicher Integrationstiefen bei der Kombination beider Systeme. In der rechenintensivsten Variante werden Parameter beider Subsysteme als Zustandsgröße des Gesamtsystems geführt, so dass sich einzelne Kameraparameter und IMU–Sensorfehler während des Betriebs schätzen und kompensieren lassen. Im Wellenkanal des Institutes für Mechanik und Meerestechnik ist kein Platz für umfangreiche Manöver oder Tests mit dem fahrenden Schwimmkörper vorhanden. Daher werden die Versuche hier auf einen\nstehenden oder langsam fahrenden Schwimmkörper beschränkt, was jedoch nur eine geringe Einschränkung für die Methodenvalidierung bedeutet. Durch ein dynamisches Positioniersystem wird der Schwimmkörper bei Wellenanregungen auf seiner Sollposition gehalten, ohne dass dabei die Roll- oder die Stampfbewegungen nennenswert angeregt werden. Die Positioniergenauigkeit liegt bei schwachen Anregungen bei schlimmstenfalls ±2mm, bei hohen Wellen und starken Bewegungen liegt die Genauigkeit bei ca. ±10mm quer zu den Wellen und ca. ±30mm in Wellenrichtung.\n\nMit dieser Versuchsanordnung ist es zukünftig möglich, unter beliebigen Winkeln zu den einfallenden Wellen gut wiederholbare Messungen durchzuführen, bei denen man sich in Abstimmung mit den Berechnungen den kritischen Systemzuständen nähern kann. Da die Messungen, die Regelung und die Wellenklappensteuerung miteinander vernetzt sind, kann diese Parametersuche weitestgehend automatisiert ablaufen und gegebenenfalls durch Optimierer beschleunigt werden. \n\nDie numerischen Untersuchungen werden durch ein hier in dieser Arbeit entwickeltes Modellreduktionsverfahren beschleunigt, mit dem die Ordnung des mathematischen Systems deutlich reduziert werden kann. Dies verkürzt zum einen die Rechenzeit, führt aber vor allen Dingen zu einem schnelleren Einschwingen des Systems auf eine periodische Bewegung.', 'deu'),
(104, 42, 'main', 'Charakterisierung von MOS-Transistoren vor und nach Gateoxiddurchbruch', 'deu'),
(105, 42, 'main', 'Characterization of MOS transistors before and after gate oxide breakdown', 'eng'),
(106, 42, 'abstract', 'Die fortschreitende Skalierung und zunehmende Packungsdichte integrierter Schaltkreise führt zu immer höheren Belastungen der elektronischen Bauelemente. Bei MOS-Transistoren erhöht sich dadurch die Wahrscheinlichkeit eines Gateoxiddurchbruchs. In der vorliegenden Arbeit werden Untersuchungen zum Verhalten von MOS-Transistoren vor und nach einem Gateoxiddurchbruch präsentiert. Dabei werden unterschiedliche Durchbruchsarten klassifiziert und Modelle für die DC-Kennlinien sowie für das Rauschen (Random Telegraph Signals) nach Durchbruch entwickelt. Mit Hilfe der Modelle wird abschließend die Funktion ausgewählter analoger und digitaler Schaltungen analysiert. Es zeigt sich, daß je nach Anwendung und Durchbruchstyp auch nach Durchbruch eines Transistors die Funktion der Schaltkreise erhalten bleiben kann. Mit diesem Ansatz kann bereits während der Design-Phase die Zuverlässigkeit der Schaltung untersucht werden.', 'deu'),
(107, 42, 'abstract', 'The continuous scaling of integrated circuits in the last decades has led to gate oxide thicknesses below 2nm in MOS transistors of state of the art technologies. Breakdown of such thin oxides becomes intrinsically more likely, and the 1 billion transistor chip is already within reach. Therefore, the probability of having at least one oxide breakdown within the projected circuit lifetime of 10 years seems quite high. In this work, the characteristics of MOS transistors before and after gate oxide breakdown are studied. Different categories of breakdown are identified and models for the dc characteristics as well as the noise (random telegraph signals) after breakdown are developed. The models are implemented to analyze the effect of breakdown on different analog and digital circuits. It is shown that, according to the application and breakdown type, circuits may be functional after breakdown of a transistor. With the presented approach it is possible to point out critical transistors in the circuit and analyze the impact of breakdown during the design stage.', 'eng'),
(108, 43, 'main', 'Fahrzeugklassifikation und Schätzung streckenbezogener Verkehrsdaten mit Methoden der Mustererkennung', 'deu'),
(109, 43, 'main', 'Vehicle Classification and Estimation of Section-Related Traffic Data Using Pattern Recognition Methods', 'eng'),
(110, 43, 'abstract', 'Im Rahmen dieser Arbeit werden für die Klassifikation und Wiedererkennung von Fahrzeugen mit Signalen von Induktionsschleifen effiziente Verfahren mit Mustererkennungssystemen angegeben. Unterschiedliche Ansätze zur Fahrzeugklassifikation u.a auch mit neuronalen Netzwerken werden untersucht und bewertet. Durch die Fahrzeugwiedererkennung können streckenbezogene Verkehrsdaten geschätzt werden. Im Vergleich zu einem Referenzverfahren werden zwei unterschiedliche Methoden entwickelt und analysiert. Das erste Verfahren benutzt Kostenfunktionen auf der Basis von Fahrzeugmerkmalen und lokalen Streckenprognosen, das zweite Verfahren berücksichtigt die statistischen Bindungen der Fahrzeuge im Streckenabschnitt durch eine Modellierung mit Hidden-Markov-Modellen. Die Einsatzmöglichkeit der streckenbezogenen Verkehrsdaten in Verkehrsleitsystemen wird abschließend anhand der Verkehrszustandsschätzung mit einem modellgestützten Schätzverfahren beschrieben.\n', 'deu'),
(111, 43, 'abstract', 'Im Rahmen dieser Arbeit werden für die Klassifikation und Wiedererkennung von Fahrzeugen mit Signalen von Induktionsschleifen effiziente Verfahren mit Mustererkennungssystemen angegeben. Unterschiedliche Ansätze zur Fahrzeugklassifikation u.a auch mit neuronalen Netzwerken werden untersucht und bewertet. Durch die Fahrzeugwiedererkennung können streckenbezogene Verkehrsdaten geschätzt werden. Im Vergleich zu einem Referenzverfahren werden zwei unterschiedliche Methoden entwickelt und analysiert. Das erste Verfahren benutzt Kostenfunktionen auf der Basis von Fahrzeugmerkmalen und lokalen Streckenprognosen, das zweite Verfahren berücksichtigt die statistischen Bindungen der Fahrzeuge im Streckenabschnitt durch eine Modellierung mit Hidden-Markov-Modellen. Die Einsatzmöglichkeit der streckenbezogenen Verkehrsdaten in Verkehrsleitsystemen wird abschließend anhand der Verkehrszustandsschätzung mit einem modellgestützten Schätzverfahren beschrieben.\n', 'eng'),
(112, 44, 'main', 'Einfluss hydrostatischer Druckbelastung während der in vitro Herstellung von dreidimensionalen Knorpelimplantaten', 'deu'),
(113, 44, 'main', 'Influence of hydrostatic pressure during cultivation of three-dimensional cartilage implants', 'eng'),
(114, 44, 'abstract', 'Aufgrund der unbefriedigenden Ergebnisse von konventionellen Behandlungsmethoden zur Heilung von verletztem Gelenkknorpel wird derzeit nach innovativen Therapiemöglichkeiten gesucht, mit denen Gelenkoberflächen wiederhergestellt werden können. Aktuell unterliegt die Herstellung von Knorpelimplantaten in vitro mit Methoden des Tissue Engineering intensiven Forschungs- und Entwicklungsarbeiten. \nDas dieser Arbeit zugrunde liegende Konzept sieht die in vitro Züchtung einer Knorpelschicht auf einem keramischen Trägermaterial als Knochenersatz zur Implantation in einen osteochondralen Defekt vor. Zunächst wurde durch Variationen im bestehenden Protokoll für porcine Chondrozyten (Wachstumsfaktoren, Kultivierungsdauer, Träger) eine Verbesserung der Knorpel-Träger-Konstrukte erreicht, um im Anschluss den Einfluss intermittierender hydrostatischer Druckbelastung während der Kultivierung mithilfe spezieller Bioreaktoren zu untersuchen. Es konnte für den vorhandenen Gasdruckreaktor ein Belastungsprotokoll festgelegt werden, mit dem eine höhere Knorpelqualität im Vergleich zu den unbelasteten Kultivierungen erzielt wurde. Um sich den höheren in situ auftretenden Frequenzen der Lastbeaufschlagung im Kniegelenk zu nähern, wurde im Anschluss ein zweiter Druckreaktor (Kolbendruckreaktor) entwickelt.\n', 'deu'),
(115, 44, 'abstract', 'An innovative therapy for the treatment of osteochondral defects which is currently under development is the in vitro generation of cartilage-carrier-constructs from autologes cells. After further development of the cultivation protocol using porcine chondrocytes the effect of intermittent hydrostatic pressure during the cultivation of these constructs in special bioreactors was investigated.', 'eng'),
(116, 45, 'main', 'Geruchsminimierung durch selektive Absorption unter Verwendung selektiver Absorbenzien und Waschölen', 'deu'),
(117, 45, 'main', 'Odour control by selective absorption using solubility agents and washing oils', 'eng'),
(118, 45, 'abstract', 'Ziel dieser Arbeit war es, Absorbenzien oder Löslichkeitsvermittler zu identifizieren,die die Abscheidung von Geruchsstoffen in Abluftwäschern verbessern. In Experimenten wurden Henry Koeffizienten für typische Geruchsstoffe in verschiedenen Waschflüssigkeiten bestimmt. Dabei wurden Waschöle und wässrige Lösungen mit Huminstoffen getestet, die ein sehr viel höheres Lösungsvermögen als Wasser aufwiesen.\nDie Eignung von Huminstoffen als Löslichkeitsvermittler für den Einsatz in Biowäschern konnte mit mehreren Versuchsreihen belegt werden. So war die Abscheiderate von Dimethylsulfid in Laborversuchen zwischen 34 and 50% höher bei Verwendung von Huminstoffen verglichen mit einem konventionellen Biowäscher. In Vor-ort-Versuchen mit einer Pilotanlage mit zwei Biowäschern im halbtechnischen Maßstab lag die Verbesserung bei einem einstufigen Verfahren nur zwischen 7% und 10%. Bei einem zweistufigen Verfahren konnte jedoch die Reinigungsleistung der zweiten Stufe durch den Einsatz von Huminstoffen von 35% to 80% erhöht werden.\nAls ein alternatives Konzept der absorptiven Abscheidung von Geruchsstoffen wurden Waschöle in einem Laborwäscher mit einer Regeneration der Waschöle mittels Wasserdampf-Strippens erfolgreich getestet. Es wurden kinetische Parameter bestimmt für Scale-up-Berechnungen und einen Vergleich der einzelnen Konzepte. Dabei zeigte sich, dass Biowäscher die effizienteste Variante einer absorptiven Abluftreinigung darstellen. In vielen Fällen kann mit geringem apparativen Aufwand die Reinigungsleistung von Biowäschern durch den Einsatz von Huminstoffen verbessert werden. Im Gegensatz dazu war der Ölwäscher das kostintensivste Konzept hinsichtlich Investition und Betrieb.', 'deu'),
(119, 45, 'abstract', 'Aim of this work was to identify alternative absorbents and solubility agents in\naqueous solutions, which improve absorption of odour substances from waste air. In experiments Henry coefficients of chosen odorants in alternative washing liquids were determined. Some oils and aqueous solutions with humic substances were found to have much higher solubility of many gases than water has.\nApplicability of humic substances as solubility agents in bioscrubbers were proofed and verified in several series of measurements. Within laboratory tests reduction rates of dimethyl sulphide were found to be between 34 and 50% higher when humic substances were applied compared to conventional bioscrubbers. At on-site tests with a pilot plant of two bioscrubbers, improvement by humic substance was only between 7% and 10%. Whereas, when both bioscrubbers were operated in series the reduction rate of the second step could be increased from 35% to 80% by usage of humic substances.\nWashing oils were tested in a laboratory air scrubber with a regeneration by steam stripping as an alternative concept of odour control. Kinetic constants were determined and used for scale-up calculations to compare required scrubber sizes of a conventional bioscrubber, a bioscrubber with humic substances and an oils scrubber. As a result a bioscrubber was proofed to be the most efficient concept of absorptive odour control. In many cases humic substances used as solubility agents improve reduction rates with little supplemental efforts. In contrast the oil scrubber was determined to be the most cost intensive concept towards investigation and operation.', 'eng'),
(120, 46, 'main', 'Universitätsbibliothek der Technischen Universität Hamburg-Harburg : Entwicklung, Aufgaben, Neubau', 'deu'),
(121, 46, 'abstract', '[Geleitwort] Mit dem Umzug der Universitätsbibliothek der Technischen Universität Hamburg-Harburg in einen Neubau auf dem Campus erhält diese die vorgesehenen, für ihre Funktion optimierten Räumlichkeiten. Hierdurch werden die Arbeitsbedingungen und damit auch die Serviceleistungen für die Mitglieder der Technischen Universität und für Nachfrager aus der Region erheblich verbessert. [...]', 'deu'),
