(140, 56, 'main', 'Elastische Schwingungen des Schiffes, erregt durch nichtlineare Kräfte des natürlichen, unregelmäßigen Seegangs', 'deu'),
(141, 56, 'abstract', 'Elastische Schwingungen des Schiffes, erregt durch nichtlineare Kräfte des natürlichen, unregelmäßigen Seegangs', 'deu'),
(142, 57, 'main', 'Determination of the Elastic-plastic Transition of Human Enamel by Nanoindentation', 'eng'),
(143, 57, 'abstract', 'Objectives/Methods: From a materials scientist''s perspective, dental materials used for tooth repair should exhibit compatible mechanical properties. Fulfillment of this criterion is complicated by the fact that teeth have a hierarchical structure with changing mechanical behavior at different length scales. In this study, nanoindentation with an 8 &#956;m spherical indenter was used to determine the elastic/plastic transition under contact loading for enamel.\n\nResults: The indentation elastic/plastic transition of enamel at the length scale of several hundreds of hydroxyapatite crystallites, which are within one enamel rod, is revealed for the first time. The corresponding penetration depth at the determined indentation yield point of 1.6 GPa and 0.6 % strain is only 7 nm. As a consequence of the small depth it is decisive for the experiment to calibrate the indenter tip radius in this loading regime. The elastic modulus of 123 GPa was evaluated directly by the Hertzian penetration and not by the unloading part of the indentation curve.\n\nSignificance: We believe these data are also a valuable contribution to understand the mechanical behavior of enamel and to develop nanoscale biomimetic materials.', 'eng'),
(144, 58, 'main', 'The fracture behaviour of dental enamel', 'eng'),
(145, 58, 'abstract', 'Abstract\nEnamel is the hardest tissue in the human body covering the crowns of teeth. Whereas the underlying dental material dentin is very well characterised in terms of mechanical and fracture properties, available data for enamel are quite limited and are apart from the most recent investigation mainly based on indentation studies. Within the current study, stable crack-growth experiments in bovine enamel have been performed, to measure fracture resistance curves for enamel. Single edge notched bending specimens (SENB) prepared out of bovine incisors were tested in 3-point bending and subsequently analysed using optical and environmental scanning electron microscopy. Cracks propagated primarily within the protein-rich rod sheaths and crack propagation occurred under an inclined angle to initial notch direction not only due to enamel rod and hydroxyapatite crystallite orientation but potentially also due to protein shearing. Determined mode I fracture resistance curves ranged from 0,8 – 1,5 MPa*m1/2 at the beginning of crack propagation up to 4,4 MPa*m1/2  at 500 &#61549;m crack extension; corresponding mode II values ranged from 0,3 to 1,5 MPa*m1/2.\n', 'deu'),
(146, 59, 'main', 'Building on experience : learning from the past to plan for the future ; documentation of new library buildings in Europe', 'deu'),
