(156, 62, 'main', 'Investigation of the dielectric and piezoelectric properties of potassiumsodium niobate ceramics close to the phase boundary at (K0.35Na0.65)NbO3 and partial substitutions with lithium and antimony', 'eng'),
(157, 62, 'abstract', 'Potassium sodium niobate (KNN) piezoelectric ceramics and KNN substituted with lithium (Li+) and antimony (Sb5+) have been synthesized by the conventional solid state sintering method. This work focuses on the phase transition in the KNN system at potassium (K+) content of approximately 0.35. Therefore, K amount was altered from 0.31 to 0.35. Additionally, Li+ and Sb5+ were used for partial substitution (up to 8% for Sb) thereby enhancing the piezoelectric and dielectric properties. However, addition of Li+ and Sb5+ also lead to a decrease in both the Curie temperature (TC) and the first order phase transition temperature (TT-O) of the ceramics. Addition of more than 4 mol% of Li+ led to the formation of extra phases. The piezoelectric properties within the given composition range were found to be optimum at (K0.34Na0.64Li0.02)(Nb0.96Sb0.04)O3. A piezoelectric charge coefficient (d33) of 404 pm/V for this composition was obtained from unipolar strain hysteresis measurements.\n\n', 'eng');
INSERT INTO `document_title_abstracts` (`id`, `document_id`, `type`, `value`, `language`) VALUES
(158, 63, 'main', 'Investigation of phase boundaries in the system (KxNa1-x)1-yLiy(Nb1-zTaz)O3 using High-Throughput Experimentation (HTE)', 'eng'),
(159, 63, 'abstract', 'A High-Throughput Experimental (HTE) approach starting from dry, fine-grained\npowders was used to synthesize bulk samples in the system (KxNa1-x)1-yLiy(Nb1-zTaz)O3, a doped variant of the piezoelectric (K0.5Na0.5)NbO3 (KNN). Starting from the system (K0.5Na0.5)1-yLiy(Nb1-zTaz)O3 known from the works of Saito et al. an effort was made toestablish a higher-order phase diagram. Special emphasis was put on expanding the known morphotropic phase boundary that constitutes a region of special interest for electroceramic materials as it features maximum piezoelectric properties. Analyses were performed using a HTE-compatible technique, namely automated powder X-ray diffraction (XRD).', 'eng'),
(160, 64, 'main', 'Effect of MnO2 on the dielectric and piezoelectric properties of Alkaline Niobate based lead free piezoelectric ceramics', 'eng'),
(161, 64, 'abstract', 'Lead free ferroelectric ceramics of the KNN–LiTaO3–LiSbO3 system were prepared\nusing the mixed oxide route. This work reports the effect of doping\n(K0.44Na0.52Li0.04)(Nb0.86Ta0.1Sb0.04)O3 produced through the conventional solid state sintering method with different amounts of MnO2. With 1 mol% of the dopant, ~ 96.5% of the theoretical density of the ceramics was achieved while grain growth inhibition was attained through pinning of the grain boundary movement. A polymorphic phase transition (PPT) was induced in the ceramic from the orthorhombic crystal structure to the tetragonal structure with increasing dopant amount. At lower temperatures, the doped samples had higher epsilon values but there was a decrease in both Tc (from 333 &#9702;C to 249 &#9702;C) and epsilon value at Tc (from &#8776;9500 to <6000). At temperatures below 300 &#9702;C however, the loss tangent in the doped samples (&#8776;2.5 mol%) was much lower and steady when compared to the undoped one. The ferroelectric properties were slightly lowered with the addition of MnO2. The remnant polarisation (Pr) was lowered from ~18&#956;C/cm2 to ~9&#956;C/cm2, the coercive field (Ec) from ~ 8.5 kV/cm to ~ 6.2 kV/cm and the piezoelectric charge coefficient (d33) decreased as well.', 'eng'),
(162, 65, 'main', 'Size-dependent elastic-inelastic behavior of enamel over millimeter and nanometer length scales', 'eng'),
(163, 65, 'abstract', 'The microstructure of enamel like most biological tissues has a hierarchical structure which determines their mechanical behavior. However, current studies of the mechanical behavior of enamel lack a systematic investigation of these hierarchical length scales. In this study, we performed macroscopic uni-axial compression tests and the spherical indentation with different indenter radii to probe enamel’s elastic/inelastic transition over four hierarchical length scales, namely: ‘bulk enamel’ (mm), ‘multiple-rod’ (10’s µm),  intra-rod’ (100’s nm with multiple crystallites) and finally ‘single-crystallite’ (10’s nm with an area of approximately one hydroxyapatite crystallite). The enamel’s elastic/inelastic transitions were observed at 0.4-17GPa depending on the length scale and were compared with the values of synthetic hydroxyapatite crystallites. The elastic limit of a material is important as it provides insights into the deformability of the material before fracture. At the smallest investigated length scale (contact radius ~20nm), elastic limit is followed by plastic deformation. At the largest investigated length scale (contact size ~1mm), only elastic then micro-crack induced response was observed. A map of elastic/inelastic regions of enamel from millimeter to nanometer length scale is presented. Possible underlying mechanisms are also discussed.', 'eng'),
