(186, 77, 'main', 'Untersuchung von Schichtsystemen für kristallisierte Dünnschichtsiliziumsolarzellen auf Glas', 'deu'),
(187, 77, 'main', 'Analysis of thin film systems for crystallised silicon solar cells on floatglass', 'eng'),
(188, 77, 'abstract', 'Solarzellenmodule auf Basis von mono- oder polykristallinen Siliziumwafern\nhaben gegenwärtig einen hohen technologischen Stand erreicht. Sowohl die\nstabilen Zellwirkungsgrade als auch die Fertigungsqualität der Module erlauben\nden Herstellern langfristige Garantiezusicherungen, die dem Anwender neben der ohnehin gewährleisteten frühzeitigen energetischen Amortisierung in Deutschland durch das erneuerbare Energiengesetz auch eine lohnende finanzielle Investition ermöglicht. Im Vergleich mit anderen Formen der Stromproduktion sind die Anfangskosten der Fotovoltaik jedoch immer noch zu hoch, um bei den gegenwärtigen Strompreisen konkurrenzfähig zu sein. Die wesentlichen Kosten und Energieaufwändungen einer Solarzelle auf Waferbasis skalieren direkt mit der Menge an eingesetztem Reinstsilizium. \nEine weitere Reduktion derWaferdicke oder der Sägeverluste ist nur noch in\nsehr begrenztem Maße möglich. Ein signifikantes Verringern des Materialeinsatzes\nlässt sich nur durch den Einsatz von materialfremden Substraten erreichen, die lediglich die mechanische Stabilität gewährleiten sollen. In dieser Arbeit wurden Substrate aus gezogenen Flachgläsern gewählt, die sowohl in der Energiebilanz als auch vom Kosteneinsparpotenzial deutlich unter dem Niveau von hochreinem Silizium liegen. Durch den Einsatz von Siliziumabscheideverfahren\nwird nur soviel Material auf dem Substrat erzeugt, wie für die elektrische Funktion erforderlich ist. Durch den Einsatz des Zonenziehprozesses entstehen polykristalline Schichten, wodurch die Materialeigenschaften denen des Wafers angeglichen werden können. Polykristalline Schichten mit Korngrößen oberhalb der Schichtdicke lassen sich nur durch ein Aufschmelzen des Siliziums erreichen. Obwohl der Erweichungspunkt der eingesetzten Flachgläser deutlich unterhalb der Siliziumschmelztemperatur liegt, wird durch den Linienelektronenstrahlprozess die zum Aufschmelzen erforderliche Temperatur in dem abgeschiedenen Silizium erreicht, ohne das darunter befindliche Glas zu beschädigen. Neben einer geeigneten Prozessführung für die Kristallisation sind zusätzliche zu dem Silizium weitere aufeinander abgestimmte Schichten erforderlich, um die Funktion der Zelle zu gewährleisten. \nDer Fokus dieser Arbeit lag darauf, Konzepte für Solarzellenschichtpakete\nzu entwerfen und diese anschließend zu realisieren. Es wurde ein Rückseitenund\nein Vorderseitenkonzept erarbeitet, wobei die grundsätzlichen Anforderungen\nan den Schichtaufbau für beide Konzepte sehr ähnlich sind. Sie bestehen\njeweils aus einem Substrat, einer Zwischenschicht, einem Absorber, einem Emitter und einer Kontaktierung. Für die mehrfachen Anforderungen an die Zwischenschicht, die sowohl Verunreinigungnen aus dem Glas zurückhalten,\nals auch der Siliziumschmelze widerstehen und gegebenenfalls elektrisch\nleitfähig sein soll, wurdenWolfram,Wolframnitrid und Siliziumkarbid als Materialien gewählt. Der eigentliche Lichtabsorber aus Silizium wurde\nwahlweise in einem LPCVD-, PECVD- oder PVD Prozess hergestellt, da hier der Fokus auf einer schnellen und kostengünstigen Lösung lag, um hochreines\nSilizium abzuscheiden. Der abschließende Emitter und die Kontaktierung\nwurden mit einem am Helmholtz Institut für solare Energiesysteme in Berlin entwickelten a-Si Heteroemitter mit TCO/Aluminium Kontaktierung ausgeführt, der auf Siliziumwafern erfolgreich erprobt wurde. Für die Realisierung der einzelnen Schichten wurden innerhalb dieser Arbeit mehrere Dünnschichtprozesse entwickelt, charakterisiert und hinsichtlich des Einsatzes in der Zelle optimiert.', 'deu'),
(189, 77, 'abstract', 'The material efford for thin film silicon solar cells on floatglass is significantly lower than for wafer based cells. Polycrystalline silicon films have been produced by zone melting crystallisation with a focussed electron beam. Layer systems based on glass, tungsten W, tungstennitride WN,siconcarbide SiC and silicon Si were produced and analysed. Realised solar cells based on these\nlayer systems showed an efficiency of 1.75%.', 'eng'),
(190, 78, 'main', 'Kavitationseinflüsse auf die vom Propeller induzierten Druckschwankungen', 'deu'),
(191, 78, 'abstract', 'Kavitationseinflüsse auf die vom Propeller induzierten Druckschwankungen', 'deu'),
(192, 79, 'main', 'Planar integriertes Mikromassenspektrometer : Simulation, Ansteuerung und Charakterisierung', 'deu'),
(193, 79, 'main', 'Planar integrated micro mass spectrometer : simulation, control and characterization', 'eng'),
(194, 79, 'abstract', 'Das Konzept, die Entwicklung und die Charakterisierung eines planar integrierten Mikromassenspektrometers (PIMMS), gefertigt in Mikrosystemtechnik, wird vorgestellt. Schwerpunkte sind die Berechnung und Simulation von Ionentrajektorien, die Elektronenerzeugung durch ein Mikroplasma und die Ansteuerelektronik. Durch die Messung von Massenspektren wird erstmals der experimentelle Funktionsnachweis des PIMMS erbracht.\n', 'deu'),
(195, 79, 'abstract', 'The concept, development and characterization of the planar integrated micro mass spectrometer (PIMMS), fabricated in microsystems technology, is presented. Key topics are the calculation and simulation of ion trajectories, the generation of electrons by a micro plasma and the control electronics. The measurement of mass spectra with the PIMMS shows the experimental proof of concept.', 'eng'),
(196, 80, 'main', 'Orthopädische Trennverfahren unter besonderer Berücksichtigung des Strahlschneidens', 'deu'),
(197, 80, 'main', 'Water-jet-cutting in orthopedic surgery', 'eng'),
(198, 80, 'abstract', 'Bei verschiedenen orthopädischen Operationen,finden sich Probleme, die den Trennprozess betreffen: bei der mikroinvasiven Nukleotomie wird der Nukleus pulposus durch einen kleinen Arbeitskanal abgetragen. Mechanische Werkzeuge oder ein LASER erlauben keinen gewebeselektiven Materialabtrag, und bergen die Gefahr andere Gewebe, wie z.B. den Anulus fibrosus zu schädigen.\nBei der Endoprothesenrevision muss gesunder Knochen geopfert werden, weil bisher bekannte Trennverfahren für den Materialabtrag im Spalt zwischen Knochen und Prothese ungeeignet sind. Bei der Endoprothesenimplantation oder der Osteotomie fehlt bisher ein athermisches Trennverfahren mit hoher geometrischer Genauigkeit. Das Trennen mit Hochdruckflüssigkeitsstrahlen hat sich u.a. beim Bearbeiten von thermosensiblen Verbundwerkstoffen bewährt. Der entscheidende Vorteil einer medizinischen DWS-Anwendung liegt in der Möglichkeit des selektiven Materialabtrags und im athermischen Trennprozess.\nZiel der vorliegenden Arbeit war es, die Eignung der DWS-Technik für operative Trennprozesse in der Orthopädie zu hinterfragen und den Materialabtragsprozess im Gewebe zu untersuchen.', 'deu'),
(199, 80, 'abstract', '...', 'eng'),
(200, 81, 'main', 'Erster Interdisziplinärer Workshop Maritime Systeme : aktuelle Ergebnisse aus laufenden Promotionsprojekten an der TUHH', 'deu'),
(201, 81, 'main', '1st Interdisciplinary Workshop on Maritime Systems - Latest Results of Ph.D. Projects at TUHH', 'eng'),
(202, 81, 'abstract', 'Es handelt sich um die Sammlung der Beiträge zum ersten Interdisziplinären Workshop Maritime Systeme der TUHH. Folgende Beiträge sind enthalten:\n - Vereinfachte Bestimmung des effektiven Nachstroms in Manövriersituationen\n - Numerische Untersuchungen zur Grundberührung von Schiffen Betriebsgrenzen von Ladeoperationen im Seegang\n - Innovative lasergestützte Schweißfertigung im Schiffbau\n - Festigkeit von mit großem Luftspalt verschweißten Stößen von Schiffssektionen\n - Mehrskalenberechnungen mit Anwendungen auf zelluläre Materialien\n - Corporate Sustainability Management in der Containerschifffahrt\n - EMV Probleme auf modernen Schiffen\n - Source Localization and Tracking with a Swarm of Autonomous Underwater Vehicles', 'deu'),
(203, 82, 'main', 'Mixed-mode stress intensity factors for kink cracks with finite kink length loaded in tension and bending', 'eng'),
(204, 82, 'abstract', 'Fracture toughness resistance curves describe a material’s resistance against crack propagation. These curves are often used to characterize biomaterials like bone, nacre or dentin as these materials commonly exhibit a pronounced increase in fracture toughness with crack extension due to co-acting mechanisms as crack bridging, crack deflection and microcracking. The knowledge of appropriate stress intensity factors which depend on sample and crack geometry is essential for determining these curves. For the dental biomaterials\nenamel and dentin it was observed that under bending and tensile loading crack propagation occurs under certain constant angles to the initial notch direction during testing procedures used for fracture resistance curves determination. For this special crack geometry (kink crack of finite length in a finite body) appropriate geometric function solutions are missing. Hence, we present in this study new mixed-mode stress intensity factors for kink cracks with finite\nkink length within samples of finite dimensions for two loading cases (tension and bending)which were derived from a combination of mixed-mode stress intensity factors of kink cracks with infinitely small kinks and of slant cracks. These results were further applied to determine fracture resistance curves of enamel and dentin by testing single edge notched bending(SENB) specimens. It was found that kink cracks with finite kink length exhibit identical stress fields as slant cracks as soon as the kink length exceeds 0,15 times the initial straight crack or notch length. The usage of stress intensity factor solutions for infinitely small kink cracks for the determination of dentin fracture resistance curves (as was done by other researchers) leads to an overestimation of dentin’s fracture resistance of up to 30%.', 'eng'),
(205, 83, 'main', 'Crack arrest within teeth at the dentinoenamel junction caused by elastic modulus mismatch', 'eng'),
(206, 83, 'abstract', 'Enamel and dentin compose the crowns of human teeth. They are joined at the dentinoenamel junction (DEJ) which is a very strong and well-bonded interface unlikely to fail within healthy teeth despite the formation of multiple cracks within enamel during a lifetime of exposure to masticatory forces. These cracks commonly are arrested when reaching the DEJ. The phenomenon of crack arrest at the DEJ is described in many publications but there is little consensus on the underlying cause and mechanism. Explanations range from the DEJ having a larger toughness than both enamel and dentin up to the assumption that not the DEJ itself causes crack arrest but the so-called mantle dentin, a thin material layer close to the DEJ that is somewhat softer than the bulk dentin. In this study we conducted 3-point bending experiments with bending bars consisting of the DEJ and surrounding enamel and dentin to investigate crack propagation and arrest within the DEJ region. Calculated stress intensities around crack tips were found to be highly influenced by the elastic modulus mismatch between enamel and dentin and hence, the phenomenon of crack arrest at the DEJ could be\nexplained accordingly via this elastic modulus mismatch.', 'eng'),
(207, 84, 'main', 'Trau keinem über 30? Die TUB wird 30! Kolloquium über eBooks  und die Zukunft der Bibliothek  anläßlich des 30-jährigen Bestehens der Universitätsbibliothek der TU Hamburg-Harburg', 'deu'),
(208, 84, 'main', 'Don''t trust anybody beyond 30? The TUB goes 30! Colloquium on eBooks and the future of the library on the occasion of the 30. anniversary of the TUHH university library', 'eng'),
(209, 84, 'abstract', '"Tüchtig Und Beliebt" – so löste TUHH-Präsident Prof. Kreuzer die Abkürzung TUB für die Universitätsbibliothek der TUHH in seinem Grußwort auf. Die TUB nahm ihr 30-jähriges Bestehen zum Anlass, sich mit der aktuellen Gegenwart und mit der Zukunft zu beschäftigen, und hatte am 4. November 2009 zur Teilnahme an einem Kolloquium mit dem Schwerpunkt E-Books in den Karl-H.-Ditze-Hörsaal der TUHH eingeladen. Das Motto der Veranstaltung lautete "Trau keinem über 30? Die TUB wird 30!" Neben der Nutzung der zur Zeit schon im Rahmen der digitalen Bibliothek der TUHH angebotenen E-Books wissenschaftlicher Verlage wurden auch spezielle Ausgabegeräte, sogenannte eBook-Reader, im Rahmen des Kolloquiums diskutiert. Nach dem Kolloquium lud die Bibliothek ein, bei einem Glas Wasser oder Wein eBook-Reader im Selbstversuch zu testen. Dieser Band dokumentiert die auf dem Kolloquium gehaltenen Vorträge und hofft damit, zur aktuellen Diskussion um eBooks und die Bibliothek der Zukunft beizutragen.\n\nNeben zwei PDF-Dateien, eine mit Verweisungen und eine im Archiv-Format von pdf, wird Ihnen dieses eBook neben einer HTML-Version auch im epub-Format für Ihren eBook-Reader angeboten.', 'deu'),
