(220, 90, 'main', 'Machbarkeitsstudie von regenwurm-unterstützten Pflanzenkläranlagen und Möglichkeit der Verwendung von alternativen Pflanzen in Pflanzenkläranlagen', 'deu'),
(221, 90, 'main', 'Implementation of earthworm-assisted constructed wetlands to treat wastewater and possibility of using alternative plants in constructed wetlands', 'eng'),
(222, 90, 'abstract', 'The aim of this research was to add the earthworms into the constructed wetlands, both in Germany and Thailand, in order to investigate whether they could improve the treatment performances. For Germany, earthworm-assisted constructed wetlands exhibited better treatment efficiency than conventional vertical subsurface-flow constructed wetlands and the unplanted constructed wetlands with earthworms.  For Thailand, the production of sludge on the surface of wetlands was reduced by 40% with earthworms. Apart from that, alternative plants with high resource recovery potential were proposed. The recommendation table was developed with 13 suitable species. There are more than one “most appropriate species” in each climatic region.', 'eng'),
(223, 90, 'abstract', 'Ziel dieser Forschungsarbeit war die Untersuchung des Potentials zur Steigerung der Effizienz von Pflanzenkläranlagen durch Zugabe von Regenwürmern. In Deutschland zeigte sich für die mit Regenwürmern unterstützen Pflanzenkläranlagen eine deutlich bessere Abbauleistung als für das einfache Pflanzenkläranlagenverfahren. In Thailand war in Versuchen mit den Regenwürmern eine um 40 % geringere Schlammbildung zu beobachten. Zusätzlich wurden verschiedene Pflanzen mit hohem Potenzial zur Wertstoffrückgewinnung in Bezug auf die Anwendung in Pflanzenkläranlagen untersucht. Eine Empfehlungstabelle mit 13 Pflanzenarten wurde entwickelt. Für jedes der  betrachteten klimatischen Gebiete eignen sich mehrere Spezies.', 'deu');
